import React, { useState, useEffect } from 'react';
import { Card } from 'react-bootstrap';
import axios from 'axios';
const ReturnCard = (props) => {
    const [returnList, setReturnList] = useState(1);
    var config = {
        method: 'get',
        url: 'http://localhost:8765/api/return/',
        headers: {
            'auth': localStorage.getItem('vmisJwt')
        }
    };
    useEffect(() => {
        return () => {
            axios(config).then(res =>
                setReturnList(res.data)
            ).catch()
        }
    }, [props.dependency])
    return (
        <div className="my-2">
            {returnList ?
                Object.keys(returnList).map((key, index) => {
                    return (
                        <Card border="secondary" style={{ width: '18rem' }} className="m-1" key={index}>
                            <Card.Header className={myRequests[key][0].status === "APPROVED" ? "bg-success text-center text-light font-weight-bolder" : "bg-warning text-center text-light font-weight-bold"}>{myRequests[key][0].status}</Card.Header>
                            <Card.Body>
                                <Card.Title>{DateParser(myRequests[key][0].date)}</Card.Title>
                                <Card.Text>
                                    <Table responsive size="sm" key={index}>
                                        <thead>
                                            <tr>
                                                <th>Vaccine</th>
                                                <th>Quantity</th>
                                            </tr>
                                        </thead>
                                        <tbody>
                                            {myRequests[key].map((key1, index1) => {
                                                return (<tr key={index1}><td>{key1.vaccinename}</td><td>{key1.quantityrequested}</td></tr>)
                                            })}
                                        </tbody>
                                    </Table>
                                </Card.Text>
                            </Card.Body>
                        </Card>
                    )
                })
                : <div className="alert alert-info text-center">No returns made yet</div>}
        </div>
    );
}

export default ReturnCard;
